import { type } from "@testing-library/user-event/dist/type"


export const inc=(value)=>async dispatch=>{
    dispatch({
        type:"INCREMENT"
    })

}

export const dec=(value)=>async dispatch=>{
    dispatch({
        type:"DECREMENT"
    })

}
